.elementor-widget-text-editor.elementor-drop-cap-view-stacked .elementor-drop-cap{background-color:#69727d;color:#fff}.elementor-widget-text-editor.elementor-drop-cap-view-framed .elementor-drop-cap{color:#69727d;border:3px solid;background-color:transparent}.elementor-widget-text-editor:not(.elementor-drop-cap-view-default) .elementor-drop-cap{margin-top:8px}.elementor-widget-text-editor:not(.elementor-drop-cap-view-default) .elementor-drop-cap-letter{width:1em;height:1em}.elementor-widget-text-editor .elementor-drop-cap{float:left;text-align:center;line-height:1;font-size:50px}.elementor-widget-text-editor .elementor-drop-cap-letter{display:inline-block}</style>				<p>The Canadian Experience Class (CEC) is a permanent resident category for individuals who had already established themselves as skilled workers in Canada. CEC program opens the door to Canada for foreign students and foreign workers. For many international graduates, Canadian Experience Class may be fastest option for achieving Canadian permanent residence. One of the objectives of the CEC is to increase the supply of skilled workers in Canada. Please note that any work experience acquired in Canada without valid work authorization will not be considered. Self-employment and work experience gained while you were a full-time student (such as on a co-op work term) doesn’t count under this program. CEC application will take some time to process. If you are currently working in Canada and you have applied for permanent residence under CEC class, you may be eligible for a bridging open work permit if your work permit will expire in four months or less. This means you can keep working while IRCC makes a decision on your permanent resident application.</p><p>As of January 1, 2015 foreign nationals will be selected through Express Entry System and must receive invitation before they may apply. Applicants can remain in Canada throughout the application process. However, the Canadian Experience Class is also open to individuals who are no longer in Canada, if they submit their application within three years of leaving their job in Canada.</p><p>To qualify for the CEC through Express Entry, you must have:</p><ul><li>at least 12 months of skilled work experience in Canada, in the last three years (before you apply). The work was: full-time OR an equal amount in part-time</li></ul>						</div>
