				<div class="elementor-widget-container">
							<ul><li>gained your work experience in Canada with the proper authorization</li><li>take approved language test and meet minimum requirements</li><li>planned to live outside the province of Quebec</li></ul><p> </p><p>To be eligible for the CEC, you need to have Canadian skilled work experience within three years of applying. According to the Canadian National Occupational Classification (NOC), skilled work experience means:</p><ul><li>Managerial jobs (NOC skill level 0)</li><li>Professional jobs (NOC skill type A)</li><li>Technical jobs and skilled trades (NOC skill type B)</li></ul><p> </p><p>Your experience must be at least</p><ul><li>12 months of full-time work: 30 hours/week for 12 months = 1 year full-time (1,560 hours), OR</li><li>equal amount in part-time hours, such as:</li><li>15 hours/week for 24 months = 1 year full time (1,560 hours)</li><li>30 hours/week for 12 months at more than one job = 1 year full time  (1,560 hours)</li><li>If your experience doesn’t meet the duty and job description requirements set in the NOC, IRCC may not accept your application.</li></ul><p> </p><p>Please note Immigration, Refugees and Citizenship Canada (IRCC) require that applicants submit government application processing fees for most of their applications.</p>						</div>
